import React from 'react';

const styles = {
  container: {
    backgroundColor: 'black', 
    color: 'white', 
    minHeight: '100vh',
    padding: '20px',
    display: 'flex',
    flexDirection: 'column',
  },
  section: {
    width: '100%', 
    boxSizing: 'border-box', 
    padding: '20px',
    marginBottom: '20px',
  },
  heading: {
    fontSize: '2.5rem',
  },
  paragraph: {
    fontSize: '1.25rem',
  },
  image: {
    width: '500vh', 
    height: '340vh', 
    border: '2px dotted black',
    margin: '0 25px 15px 0',
  },
  imageFloatRight: {
    float: 'right',
  },
  imageFloatLeft: {
    float: 'left',
  },
};

const CricketPage = () => (
  <div style={styles.container}>
    <div style={styles.section}>
      <h1 style={styles.heading}>Cricket<br /></h1>
      <p style={styles.paragraph}>
        <img 
          src="/images/Cricket.jpg" 
          alt="Cricket" 
          style={{ ...styles.image, ...styles.imageFloatRight }} 
        />
        In the paragraph below, the image will float to the right. A dotted black border is added to the image. 
        We have also added margins to the image to push the text away from the image:
        0 px margin on the top and right side, 15 px margin on the bottom, and 20 px margin on the left side of the image.
      </p>
    </div>
    <div style={styles.section}>
      <h1 style={styles.heading}>Cricket<br /></h1>
      <p style={styles.paragraph}>
        <img 
          src="/images/Cricket.jpg" 
          alt="Cricket" 
          style={{ ...styles.image, ...styles.imageFloatLeft }} 
        />
        In the paragraph below, the image will float to the left. A dotted black border is added to the image. 
        We have also added margins to the image to push the text away from the image:
        0 px margin on the top and right side, 15 px margin on the bottom, and 20 px margin on the left side of the image.
      </p>
    </div>
    <div style={styles.section}>
      <h1 style={styles.heading}>Cricket<br /></h1>
      <p style={styles.paragraph}>
        <img 
          src="/images/Cricket.jpg" 
          alt="Cricket" 
          style={{ ...styles.image, ...styles.imageFloatRight }} 
        />
        In the paragraph below, the image will float to the right. A dotted black border is added to the image. 
        We have also added margins to the image to push the text away from the image:
        0 px margin on the top and right side, 15 px margin on the bottom, and 20 px margin on the left side of the image.
      </p>
    </div>
  </div>
);

export default CricketPage;
